import React from 'react';
import TodoList from '../components/TodoList';
import './TodoPage.css'

const TodoPage = () => {
    return (
        <div className='divComp'>
            <button>Back to Menu</button>
        <div className="TodoPage">
            <h1>Minha Todo List</h1>
            <TodoList/>
        </div>
        </div>
    );
};

export default TodoPage;
